(2, 40496, 'Maou Gakuin no Futekigousha: Shijou Saikyou no Maou no Shiso, Tensei shite Shison-tachi no Gakkou e Kayou', '魔王学院の不適合者 ～史上最強の魔王の始祖、転生して子孫たちの学校へ通う～', 'The Misfit of Demon King Academy: History\'s Strongest Demon King Reincarnates and Goes to School with His Descendants', 'Action,Fantasy,Mythology,Reincarnation,School', 1, 1, 2, 2, '13', 'In the distant past, a war between humans and demons brought about widespread chaos and bloodshed. To put an end to this seemingly endless conflict, Demon King Anos Voldigoad willingly sacrificed his life, hoping to be reborn in a peaceful future.\r\n\r\nIn preparation for their king\'s return, the demon race created the Demon King Academy, an elite institution tasked with determining Anos\' identity when he reawakens. He reincarnates two millennia later, but to his surprise, he soon learns that the level of magic in the world has drastically waned during his absence. Moreover, when he enrolls at the academy to reclaim his rightful title, he finds out that demonkind remembers him differently. His personality, his deeds, and even his legacy are all falsified—masked beneath the name of an impostor. This \"lack\" of common knowledge renders him the academy\'s outlier—a misfit never before seen in history.\r\n\r\nDespite these drawbacks, Anos remains unfazed. As he sets out to uncover those altering his glorious past, he takes it upon himself to make his descendants recognize that their ruler has finally returned.\r\n\r\n', 'https://cdn.myanimelist.net/images/anime/1126/108573l.jpg', '2020', 3, 4, '7.37', 1, '23 min per ep', '1xmzzF0XQEY', '2020-07-04', '2020-09-26', 'SILVER LINK.', 'Aniplex,Movic,AT-X,Studio Mausu,Tokyo MX,Q-Tec,Docomo Anime Store,Medicos Entertainment,BS11,Contents Seed,Kadokawa,ADK Marketing Solutions', 'https://mangahub.io/manga/maou-gakuin-no-futekigousha', '[{\"url\": \"https://maohgakuin.com/1st/\", \"name\": \"Official Site\"}, {\"url\": \"https://anidb.net/perl-bin/animedb.pl?show=anime&aid=15131\", \"name\": \"AniDB\"}, {\"url\": \"https://www.animenewsnetwork.com/encyclopedia/anime.php?id=22555\", \"name\": \"ANN\"}, {\"url\": \"https://en.wikipedia.org/wiki/The_Misfit_of_Demon_King_Academy#Anime\", \"name\": \"Wikipedia\"}]', '{\"Sequel\": [{\"type\": \"anime\", \"mal_id\": 48417}], \"Adaptation\": [{\"type\": \"manga\", \"mal_id\": 115437}]}', 92, 92, 92, '2023-09-24 12:07:13', '2023-09-24 12:07:13', NULL),
(3, 48417, 'Maou Gakuin no Futekigousha: Shijou Saikyou no Maou no Shiso, Tensei shite Shison-tachi no Gakkou e Kayou II', '魔王学院の不適合者 ～史上最強の魔王の始祖、転生して子孫たちの学校へ通う～ II', 'Maou Gakuin no Futekigousha: Shijou Saikyou no Maou no Shiso, Tensei shite Shison-tachi no Gakkou e Kayou 2nd Season, The Misfit of Demon King Academy 2nd Season', 'Action,Fantasy,Mythology,Reincarnation,School', 1, 1, 1, 2, '12', 'As peace returns to the demon realm, Anos Voldigoad wishes nothing more than to put his reputation as the Demon King of Tyranny to rest and go back to being a misfit at the prestigious Demon King Academy. Unfortunately, any tranquility is fleeting: sinister demons, kings, and deities plot Anos\'s demise from the shadows.\r\n\r\nRumors spread about the \"Child of God,\" a being whose power may rival that of Anos. To uncover the truth and eliminate the potential threat, Anos must journey deep into the land of spirits. However, the spirit world is shrouded in mystery, and it may only be entered after undergoing a series of difficult trials.\r\n\r\nWith unrivaled power and confidence, Anos braces himself to defeat various formidable enemies with grandiose titles. But he—with the assistance of his trusted allies—will barely have to break a sweat as the true Demon King of Tyranny.\r\n\r\n', 'https://cdn.myanimelist.net/images/anime/1475/137152l.jpg', '2023', 1, 4, '6.83', 1, '23 min per ep', '9u32S8C8L3g', '2023-01-08', '2023-09-24', 'SILVER LINK.', 'Aniplex,Movic,AT-X,Tokyo MX,Q-Tec,Docomo Anime Store,Medicos Entertainment,BS11,Yomiuri TV Enterprise,Contents Seed,Kadokawa,ADK Marketing Solutions', 'https://mangahub.io/manga/maou-gakuin-no-futekigousha', '[{\"url\": \"https://maohgakuin.com/\", \"name\": \"Official Site\"}, {\"url\": \"https://twitter.com/maohgakuin\", \"name\": \"@maohgakuin\"}, {\"url\": \"https://anidb.net/perl-bin/animedb.pl?show=anime&aid=16101\", \"name\": \"AniDB\"}, {\"url\": \"https://www.animenewsnetwork.com/encyclopedia/anime.php?id=24105\", \"name\": 