(5, 39535, 'Mushoku Tensei: Isekai Ittara Honki Dasu', '無職転生 ～異世界行ったら本気だす～', 'Jobless Reincarnation: I Will Seriously Try If I Go To Another World', 'Adventure,Drama,Fantasy,Ecchi,Isekai,Reincarnation', 1, 1, 2, 2, '11', 'Despite being bullied, scorned, and oppressed all of his life, a 34-year-old shut-in still found the resolve to attempt something heroic—only for it to end in a tragic accident. But in a twist of fate, he awakens in another world as Rudeus Greyrat, starting life again as a baby born to two loving parents.\r\n\r\nPreserving his memories and knowledge from his previous life, Rudeus quickly adapts to his new environment. With the mind of a grown adult, he starts to display magical talent that exceeds all expectations, honing his skill with the help of a mage named Roxy Migurdia. Rudeus learns swordplay from his father, Paul, and meets Sylphiette, a girl his age who quickly becomes his closest friend.\r\n\r\nAs Rudeus\' second chance at life begins, he tries to make the most of his new opportunity while conquering his traumatic past. And perhaps, one day, he may find the one thing he could not find in his old world—love.\r\n\r\n[Written by MAL Rewrite]', 'https://cdn.myanimelist.net/images/anime/1530/117776l.jpg', '2021', 1, 4, '8.37', 1, '23 min per ep', 'Qx01pn9l-6g', '2021-01-11', '2021-03-22', 'Studio Bind', 'Frontier Works,TOHO animation,Hakuhodo DY Music & Pictures,BS11,Egg Firm,Kadokawa,GREE,Toho Music', '', '[{\"url\": \"https://mushokutensei.jp/\", \"name\": \"Official Site\"}, {\"url\": \"https://twitter.com/mushokutensei_A\", \"name\": \"@mushokutensei_A\"}, {\"url\": \"https://anidb.net/perl-bin/animedb.pl?show=anime&aid=14758\", \"name\": \"AniDB\"}, {\"url\": \"https://www.animenewsnetwork.com/encyclopedia/anime.php?id=22589\", \"name\": \"ANN\"}, {\"url\": \"https://en.wikipedia.org/wiki/Mushoku_Tensei#Anime\", \"name\": \"Wikipedia\"}, {\"url\": \"https://ja.wikipedia.org/wiki/%E7%84%A1%E8%81%B7%E8%BB%A2%E7%94%9F_-_%E7%95%B0%E4%B8%96%E7%95%8C%E8%A1%8C%E3%81%A3%E3%81%9F%E3%82%89%E6%9C%AC%E6%B0%97%E3%81%A0%E3%81%99_-\", \"name\": \"Wikipedia\"}, {\"url\": \"https://cal.syoboi.jp/tid/5851\", \"name\": \"Syoboi\"}, {\"url\": \"https://bangumi.tv/subject/277554\", \"name\": \"Bangumi\"}]', '{\"Sequel\": [{\"type\": \"anime\", \"mal_id\": 45576}], \"Adaptation\": [{\"type\": \"manga\", \"mal_id\": 70261}]}', 116, 116, 116, '2023-09-24 14:42:19', '2023-09-24 14:42:19', NULL),
(6, 45576, 'Mushoku Tensei: Isekai Ittara Honki Dasu Part 2', '無職転生 ～異世界行ったら本気だす～ 第2クール', '', 'Adventure,Drama,Fantasy,Ecchi,Isekai,Reincarnation', 1, 1, 2, 2, '12', 'After the mysterious mana calamity, Rudeus Greyrat and his fierce student Eris Boreas Greyrat are teleported to the Demon Continent. There, they team up with their newfound companion Ruijerd Supardia—the former leader of the Superd\'s Warrior group—to form \"Dead End,\" a successful adventurer party. Making a name for themselves, the trio journeys across the continent to make their way back home to Fittoa.\r\n\r\nFollowing the advice he received from the faceless god Hitogami, Rudeus saves Kishirika Kishirisu, the Great Emperor of the Demon World, who rewards him by granting him a strange power. Now, as Rudeus masters the powerful ability that offers a number of new opportunities, it might prove to be more than what he bargained for when unexpected dangers threaten to hinder their travels.\r\n\r\n[Written by MAL Rewrite]', 'https://cdn.myanimelist.net/images/anime/1028/117777l.jpg', '2021', 4, 4, '8.69', 1, '23 min per ep', 'BbbRytVhaDs', '2021-10-04', '2021-12-20', 'Studio Bind', 'Frontier Works,TOHO animation,Tokyo MX,Hakuhodo DY Music & Pictures,BS11,Egg Firm,Kadokawa,GREE Entertainment', '', '[{\"url\": \"https://mushokutensei.jp/\", \"name\": \"Official Site\"}, {\"url\": \"https://twitter.com/mushokutensei_A\", \"name\": \"@mushokutensei_A\"}, {\"url\": \"https://anidb.net/perl-bin/animedb.pl?show=anime&aid=15954\", \"name\": \"AniDB\"}, {\"url\": \"https://www.animenewsnetwork.com/encyclopedia/anime.php?id=24164\", \"name\": \"ANN\"}, {\"url\": \"https://en.wikipedia.org/wiki/Mushoku_Tensei#Anime\", \"name\": \"Wikipedia\"}, {\"url\": \"https://ja.wikipedia.org/wiki/%E7%84%A1%E8%81%B7%E8%BB%A2%E7%94%9F_%E3%80%9C%E7%95%B0%E4%B8%96%E7%95%8C%E8%A1%8C%E3%81%A3%E3%81%9F%E3%82%89%E6%9C%AC%E6%B0%97%E3%81%A0%E3%81%99%E3%80%9C\", \"name\": \"Wikipedia\"}, {\"url\": \"https://cal.syoboi.jp/tid/6113\", \"name\": \"Syoboi\"}, {\"url\": \"https://bangumi.tv/subject/325585\", \"name\": \"Bangumi\"}]', '{\"Sequel\": [{\"type\": \"anime\", \"mal_id\": 55818}], \"Prequel\": [{\"type\": \"anime\", \"mal_id\": 39535}], \"Adaptation\": [{\"type\": \"manga\", \"mal_id\": 70261}], \"Side story\": [{\"type\": \"anime\", \"mal_id\": 50360}]}', 15, 15, 15, '2023-09-24 14:42:32', '2023-09-24 14:42:32', NULL),
(7, 50360, 'Mushoku Tensei: Isekai Ittara Honki Dasu - Eris no Goblin Toubatsu', '無職転生 ～異世界行ったら本気だす～ エリスのゴブリン討伐', 'Mushoku Tensei: Jobless Reincarnation Special, Mushoku Tensei: Isekai Ittara Honki Dasu Special', 'Drama,Fantasy,Ecchi,Isekai,Reincarnation', 5, 1, 2, 2, '1', 'Unaired episode included in the fourth Blu-ray volume. The episode will take place during the same time in episode 16 (episode 5 in second cours) and depict what Eris and Ruijerd were up to outside the main story, as teased by the comment \"Goblin Extermination.\"\r\n\r\n(Source: MAL News)', 'https://cdn.myanimelist.net/images/anime/1094/120148l.jpg', '2022', 1, 4, '7.86', 1, '23 min', 'D_u6BZYp93U', '2022-03-16', '?', 'Studio Bind', 'Frontier Works,TOHO animation,Hakuhodo DY Music & Pictures,BS11,Egg Firm,Kadokawa,GREE Entertainment', '', '[{\"url\": \"https://mushokutensei.jp/bluray/bluray04/\", \"name\": \"Official Site\"}, {\"url\": \"https://anidb.net/perl-bin/animedb.pl?show=anime&aid=15954\", \"name\": \"AniDB\"}, {\"url\": \"https://www.animenewsnetwork.com/encyclopedia/anime.php?id=24969\", \"name\": \"ANN\"}, {\"url\": \"https://en.wikipedia.org/wiki/Mushoku_Tensei#Anime\", \"name\": \"Wikipedia\"}]', '{\"Adaptation\": [{\"type\": \"manga\", \"mal_id\": 70261}], \"Parent story\": [{\"type\": \"anime\", \"mal_id\": 45576}]}', 80, 80, 80, '2023-09-24 14:43:03', '2023-09-24 14:43:03', NULL),
(8, 55818, 'Mushoku Tensei II: Isekai Ittara Honki Dasu - Shugo Jutsushi Fitz', '無職転生Ⅱ ～異世界行ったら本気だす～ 第0話「守護術師フィッツ」', 'Mushoku Tensei Ⅱ: Isekai Ittara Honki Dasu Episode 0', 'Adventure,Drama,Fantasy,Ecchi,Isekai,Reincarnation', 5, 1, 2, 2, '1', 'Episode 0 of Mushoku Tensei II: Isekai Ittara Honki Dasu.', 'https://cdn.myanimelist.net/images/anime/1627/136934l.jpg', '2023', 1, 4, '7.49', 1, '24 min', '', '2023-07-03', '?', 'Studio Bind', 'Frontier Works,TOHO animation,Hakuhodo DY Music & Pictures,BS11,Egg Firm,Kadokawa,GREE Entertainment', '', '[{\"url\": \"https://mushokutensei.jp/\", \"name\": \"Official Site\"}, {\"url\": \"https://anidb.net/perl-bin/animedb.pl?show=anime&aid=17236\", \"name\": \"AniDB\"}]', '{\"Sequel\": [{\"type\": \"anime\", \"mal_id\": 51179}], \"Prequel\": [{\"type\": \"anime\", \"mal_id\": 45576}], \"Adaptation\": [{\"type\": \"manga\", \"mal_id\": 70261}]}', 39, 39, 39, '2023-09-24 14:43:21', '2023-09-24 14:43:21', NULL),
(9, 51179, 'Mushoku Tensei II: Isekai Ittara Honki Dasu', '無職転生 II ～異世界行ったら本気だす～', 'Jobless Reincarnation: I Will Seriously Try If I Go To Another World, Mushoku Tensei: Isekai Ittara Honki Dasu 2nd Season', 'Adventure,Drama,Fantasy,Ecchi,Isekai,Reincarnation', 1, 1, 1, 2, '12', 'After his relationship with Eris Boreas Greyrat reaches new heights, Rudeus Greyrat is ecstatic. Unfortunately, his joy is short-lived, as Eris suddenly abandons him to embark on her own journey. Believing that Eris has lost all interest in him, a heartbroken and depressed Rudeus sets forth to the Northern Territories. With his sole goal being to locate his mother on the vast continent, Rudeus wonders if persisting through daily life is worth the pain, falling into a robotic routine as he endlessly ruminates on his lost love.\r\n\r\nHowever, the dangers of the North soon prove that one cannot survive with a dulled mind. While on a quest with the party Counter Arrow, with whom he recently became acquainted, Rudeus has a brush with death—an experience that forces him to finally snap out of his despair. With his newfound teammates, Rudeus rediscovers the pleasure of daily adventuring and moves forward with his original goal of living his second lease on life to the fullest.\r\n\r\n[Written by MAL Rewrite]', 'https://cdn.myanimelist.net/images/anime/1898/138005l.jpg', '2023', 3, 4, '8.5', 1, '23 min per ep', 'keti2rbgI6c', '2023-07-10', '2023-09-25', 'Studio Bind', 'Frontier Works,TOHO animation,Hakuhodo DY Music & Pictures,BS11,Egg Firm,Kadokawa,GREE Entertainment', '', '[{\"url\": \"https://mushokutensei.jp/\", \"name\": \"Official Site\"}, {\"url\": \"https://twitter.com/mushokutensei_A\", \"name\": \"@mushokutensei_A\"}, {\"url\": \"https://anidb.net/perl-bin/animedb.pl?show=anime&aid=17236\", \"name\": \"AniDB\"}, {\"url\": \"https://www.animenewsnetwork.com/encyclopedia/anime.php?id=25412\", \"name\": \"ANN\"}, {\"url\": \"https://en.wikipedia.org/wiki/Mushoku_Tensei#Anime\", \"name\": \"Wikipedia\"}, {\"url\": \"https://ja.wikipedia.org/wiki/%E7%84%A1%E8%81%B7%E8%BB%A2%E7%94%9F_%E3%80%9C%E7%95%B0%E4%B8%96%E7%95%8C%E8%A1%8C%E3%81%A3%E3%81%9F%E3%82%89%E6%9C%AC%E6%B0%97%E3%81%A0%E3%81%99%E3%80%9C_(%E3%82%A2%E3%83%8B%E3%83%A1)\", \"name\": \"Wikipedia\"}, {\"url\": \"https://cal.syoboi.jp/tid/6721\", \"name\": \"Syoboi\"}, {\"url\": \"https://bgm.tv/subject/373247\", \"name\": \"Bangumi\"}]', '{\"Sequel\": [{\"type\": \"anime\", \"mal_id\": 55888}], \"Prequel\": [{\"type\": \"anime\", \"mal_id\": 55818}], \"Adaptation\": [{\"type\": \"manga\", \"mal_id\": 70261}]}', 11, 11, 11, '2023-09-24 14:43:39', '2023-09-24 14:43:39', NULL),
