(11, 52034, '\"Oshi no Ko\"', '【推しの子】', 'My Star', 'Drama,Supernatural,Reincarnation,Showbiz,Seinen', 1, 1, 2, 1, '11', 'In the entertainment world, celebrities often show exaggerated versions of themselves to the public, concealing their true thoughts and struggles beneath elaborate lies. Fans buy into these fabrications, showering their idols with undying love and support, until something breaks the illusion. Sixteen-year-old rising star Ai Hoshino of pop idol group B Komachi has the world captivated; however, when she announces a hiatus due to health concerns, the news causes many to become worried.\r\n\r\nAs a huge fan of Ai, gynecologist Gorou Amemiya cheers her on from his countryside medical practice, wishing he could meet her in person one day. His wish comes true when Ai shows up at his hospital—not sick, but pregnant with twins! While the doctor promises Ai to safely deliver her children, he wonders if this encounter with the idol will forever change the nature of his relationship with her.\r\n\r\n', 'https://cdn.myanimelist.net/images/anime/1812/134736l.jpg', '2023', 2, 3, '8.77', 1, '30 min per ep', '1yXa8MAmocQ', '2023-04-12', '2023-06-28', 'Doga Kobo', 'Shueisha,CyberAgent,Kadokawa', '', '[{\"url\": \"https://ichigoproduction.com/\", \"name\": \"Official Site\"}, {\"url\": \"https://twitter.com/anime_oshinoko\", \"name\": \"@anime_oshinoko\"}, {\"url\": \"https://twitter.com/oshinoko_global\", \"name\": \"@oshinoko_global\"}, {\"url\": \"https://www.youtube.com/@anime_oshinoko/\", \"name\": \"YouTube\"}, {\"url\": \"https://anidb.net/perl-bin/animedb.pl?show=anime&aid=17449\", \"name\": \"AniDB\"}, {\"url\": \"https://www.animenewsnetwork.com/encyclopedia/anime.php?id=25783\", \"name\": \"ANN\"}, {\"url\": \"https://en.wikipedia.org/wiki/Oshi_no_Ko#Anime\", \"name\": \"Wikipedia\"}, {\"url\": \"https://ja.wikipedia.org/wiki/%E3%80%90%E6%8E%A8%E3%81%97%E3%81%AE%E5%AD%90%E3%80%91#%E3%83%86%E3%83%AC%E3%83%93%E3%82%A2%E3%83%8B%E3%83%A1\", \"name\": \"Wikipedia\"}, {\"url\": \"https://cal.syoboi.jp/tid/6676\", \"name\": \"Syoboi\"}, {\"url\": \"https://bangumi.tv/subject/386809\", \"name\": \"Bangumi\"}, {\"url\": \"https://baike.baidu.com/item/%E3%80%90%E6%88%91%E6%8E%A8%E7%9A%84%E5%AD%A9%E5%AD%90%E3%80%91/61376700?fromModule=search-result_lemma\", \"name\": \"Baidu Baike\"}, {\"url\": \"https://movie.douban.com/subject/35936775/\", \"name\": \"Douban\"}]', '{\"Other\": [{\"type\": \"anime\", \"mal_id\": 55016}], \"Sequel\": [{\"type\": \"anime\", \"mal_id\": 55791}], \"Adaptation\": [{\"type\": \"manga\", \"mal_id\": 126146}]}', 18, 18, 18, '2023-09-25 15:13:19', '2023-09-25 15:13:19', NULL),
(12, 55791, '\"Oshi no Ko\" Season 2', '【推しの子】第2', 'My Star Season 2', 'Drama,Supernatural,Reincarnation,Showbiz,Seinen', 1, 1, 3, 1, '?', 'Second season of \"Oshi no Ko\".', 'https://cdn.myanimelist.net/images/anime/1477/136727l.jpg', '', 1, 3, '', 1, 'Unknown', 'Cxfr5hENj54', '', '?', 'Doga Kobo', '', '', '[{\"url\": \"https://ichigoproduction.com/\", \"name\": \"Official Site\"}, {\"url\": \"https://twitter.com/anime_oshinoko\", \"name\": \"@anime_oshinoko\"}, {\"url\": \"https://twitter.com/oshinoko_global\", \"name\": \"@oshinoko_global\"}, {\"url\": \"https://www.youtube.com/@anime_oshinoko\", \"name\": \"YouTube\"}, {\"url\": \"https://anidb.net/perl-bin/animedb.pl?show=anime&aid=18086\", \"name\": \"AniDB\"}, {\"url\": \"https://www.animenewsnetwork.com/encyclopedia/anime.php?id=28810\", \"name\": \"ANN\"}, {\"url\": \"https://en.wikipedia.org/wiki/Oshi_no_Ko#Anime\", \"name\": \"Wikipedia\"}, {\"url\": \"https://ja.wikipedia.org/wiki/%E3%80%90%E6%8E%A8%E3%81%97%E3%81%AE%E5%AD%90%E3%80%91#%E3%83%86%E3%83%AC%E3%83%93%E3%82%A2%E3%83%8B%E3%83%A1\", \"name\": \"Wikipedia\"}]', '{\"Prequel\": [{\"type\": \"anime\", \"mal_id\": 52034}], \"Adaptation\": [{\"type\": \"manga\", \"mal_id\": 126146}]}', 1, 1, 1, '2023-09-25 15:13:38', '2023-09-25 15:13:38', NULL),
(13, 298, '.hack--Tasogare no Udewa Densetsu', '.hack//黄昏の腕輪伝説', '.hack//Udeden, .hack//Legend of the Twilight Bracelet, .hack//DUSK', 'Adventure,Comedy,Fantasy,Video Game,Shounen', 1, 1, 2, 1, '12', 'Winning the legendary characters \"Kite\" and \"Black Rose\" from an event held by the creators of the MMORPG \"The World,\" Shugo and his twin sister Rena step into \"The World.\" Together, they complete events and quests, along with their new friends Ouka, Mirelle, Hotaru, and Sanjuro. Soon after, mysterious monsters appear, and death by these monsters causes players to slip into a coma in the real world. Only Shugo and Rena can solve this problem, but why are they being targeted, and what secrets is the game hiding?\r\n\r\n', 'https://cdn.myanimelist.net/images/anime/4/78321l.jpg', '2003', 1, 3, '6.56', 1, '23 min per ep', '', '2003-01-09', '2003-03-27', 'Bee Train', 'Bandai Visual,Yomiko Advertising', '', '[{\"url\": \"http://www.bandaivisual.co.jp/hack_udeden/\", \"name\": \"Official Site\"}, {\"url\": \"https://anidb.net/perl-bin/animedb.pl?show=anime&aid=447\", \"name\": \"AniDB\"}, {\"url\": \"https://www.animenewsnetwork.com/encyclopedia/anime.php?id=1963\", \"name\": \"ANN\"}, {\"url\": \"http://en.wikipedia.org/wiki/.hack//Legend_of_the_Twilight\", \"name\": \"Wikipedia\"}]', '{\"Other\": [{\"type\": \"anime\", \"mal_id\": 9332}], \"Prequel\": [{\"type\": \"anime\", \"mal_id\": 48}], \"Adaptation\": [{\"type\": \"manga\", \"mal_id\": 117}], \"Side story\": [{\"type\": \"anime\", \"mal_id\": 454}, {\"type\": \"anime\", \"mal_id\": 1994}], \"Alternative setting\": [{\"type\": \"anime\", \"mal_id\": 873}]}', 1, 1, 1, '2023-09-27 15:18:10', '2023-09-27 15:18:10', NULL),
(14, 33049, 'Fate-stay night Movie: Heaven\'s Feel - II. Lost Butterfly', '劇場版「Fate/stay night [Heaven\'s Feel] II.lost butterfly」', 'Fate/stay night Movie: Heaven\'s Feel 2', 'Action,Fantasy,Supernatural', 2, 1, 2, 1, '1', 'The Fifth Holy Grail War continues, and the ensuing chaos results in higher stakes for all participants. Shirou Emiya continues to participate in the war, aspiring to be a hero of justice who saves everyone. He sets out in search of the truth behind a mysterious dark shadow and its murder spree, determined to defeat it.\r\n\r\nMeanwhile, Shinji Matou sets his own plans into motion, threatening Shirou through his sister Sakura Matou. Shirou and Rin Toosaka battle Shinji, hoping to relieve Sakura from the abuses of her brother. But the ugly truth of the Matou siblings begins to surface, and many dark secrets are exposed.\r\n\r\nFate/stay night Movie: Heaven\'s Feel - II. Lost Butterfly continues to focus on the remaining Masters and Servants as they fight each other in the hopes of obtaining the Holy Grail. However, as darkness arises within Fuyuki City, even the state of their sacred war could be in danger.\r\n\r\n', 'https://cdn.myanimelist.net/images/anime/1974/98158l.jpg', '2019', 1, 4, '8.49', 1, '1 hr 57 min', 'NhJQDAIwQVc', '2019-01-12', '?', 'ufotable', 'Aniplex,Notes,Kadokawa', '', '[{\"url\": \"http://www.fate-sn.com/hf/\", \"name\": \"Official Site\"}, {\"url\": \"https://twitter.com/fate_sn_anime\", \"name\": \"@fate_sn_anime\"}, {\"url\": \"https://anidb.net/perl-bin/animedb.pl?show=anime&aid=10755\", \"name\": \"AniDB\"}, {\"url\": \"https://www.animenewsnetwork.com/encyclopedia/anime.php?id=20899\", \"name\": \"ANN\"}, {\"url\": \"http://en.wikipedia.org/wiki/Fate/stay_night:_Heaven%27s_Feel\", \"name\": \"Wikipedia\"}, {\"url\": \"https://ja.wikipedia.org/wiki/Fate%2Fstay_night_%28%E3%82%A2%E3%83%8B%E3%83%A1%29\", \"name\": \"Wikipedia\"}, {\"url\": \"https://cal.syoboi.jp/tid/4698\", \"name\": \"Syoboi\"}]', '{\"Sequel\": [{\"type\": \"anime\", \"mal_id\": 33050}], \"Prequel\": [{\"type\": \"anime\", \"mal_id\": 25537}], \"Adaptation\": [{\"type\": \"manga\", \"mal_id\": 88110}]}', 13, 13, 13, '2023-09-27 15:24:48', '2023-09-27 15:24:48', NULL),
(15, 52611, 'Okashi na Tensei', 'おかしな転生', 'Treat of Reincarnation', 'Fantasy,Isekai,Reincarnation', 1, 1, 2, 2, '12', 'When a genius patissier dies in a tragic accident before achieving his dream of creating the world\'s greatest sweets, he is reincarnated as nine-year-old Pastry Mille \"Pas\" Morteln. Now in a medieval world brimming with swords and magic, Pas enjoys a peaceful life in the Fief of Morteln under the authority of his father, the military hero Lord Casserole. However, scarce ingredients render sweets a luxury, so Pas can only dream of baking.\r\n\r\nOnce news arrives of approaching bandits, Pas must learn magic and fight to defend his land, all to one day create a confectionery paradise!\r\n\r\n', 'https://cdn.myanimelist.net/images/anime/1251/136232l.jpg', '2023', 3, 3, '6.72', 1, '23 min per ep', 'cCGLNfDm9Rg', '2023-07-04', '2023-09-19', 'SynergySP', 'Imagin,MediaNet,Movic,KlockWorx,Crunchyroll,U-NEXT,TO Books,CTW', '', '[{\"url\": \"https://okashinatensei-pr.com\", \"name\": \"Official Site\"}, {\"url\": \"https://twitter.com/okashinatensei\", \"name\": \"@okashinatensei\"}, {\"url\": \"https://anidb.net/perl-bin/animedb.pl?show=anime&aid=17553\", \"name\": \"AniDB\"}, {\"url\": \"https://www.animenewsnetwork.com/encyclopedia/anime.php?id=26180\", \"name\": \"ANN\"}, {\"url\": \"https://en.wikipedia.org/wiki/Sweet_Reincarnation#Anime\", \"name\": \"Wikipedia\"}, {\"url\": \"https://ja.wikipedia.org/wiki/%E3%81%8A%E3%81%8B%E3%81%97%E3%81%AA%E8%BB%A2%E7%94%9F#%E3%83%86%E3%83%AC%E3%83%93%E3%82%A2%E3%83%8B%E3%83%A1\", \"name\": \"Wikipedia\"}, {\"url\": \"https://cal.syoboi.jp/tid/6735\", \"name\": \"Syoboi\"}, {\"url\": \"https://bangumi.tv/subject/347942\", \"name\": \"Bangumi\"}]', '{\"Other\": [{\"type\": \"anime\", \"mal_id\": 55753}], \"Adaptation\": [{\"type\": \"manga\", \"mal_id\": 150114}]}', 0, 0, 0, '2023-09-27 20:25:08', '2023-09-27 20:25:08', NULL);
